import "./App.css";

class App extends Component {
  state = {};
  render() {
    return (
      <>
        <Row className="nav">
          <Col xs="12">
            <Row>
              <Col xs="6" sm="6" md="2">
                <img src={logo} />
              </Col>
              <Col xs="6" sm="6" md="10">
                <span>Agendar mi visita</span>
              </Col>
            </Row>
          </Col>
        </Row>
        <Row>
          <Col xs="12" lg={{ size: 10, offset: 1 }}>
            <p className="date-title">
              Completa los siguientes pasos y reserva tu lugar Â¡Ahora!
            </p>
            <div className="stepper-cont">
              <div className="stepper-line" />
              <div className="stepper-step">
                <FontAwesomeIcon icon={["far", "calendar-check"]} />
              </div>
              <div className="stepper-step">
                <FontAwesomeIcon icon={["fas", "user-check"]} />
              </div>
            </div>
          </Col>
        </Row>
      </>
    );
  }
}

export default App;
